import axios from 'axios';

export async function getCalendar() {
  const getCalendar = () => {
    axios.get('https://google.com/auth/calendar')
    .then(res => {
      console.log(res);
    }).catch(err => {
      console.log(err);
    })

  }
  console.log(getCalendar);
  return getCalendar;
};
